`pebble-icons` Represents an utility import that includes the definition for the `iron-icon` element, 
`pebble-iconset-svg` element, as well as an import for the default icon set.

Your project can get loaded with the `pebble-icons` directory which also includes imports for additional icon sets.

Example for loading the set of icons:

    <link rel="import" href="../pebble-icons/pebble-icons.html">

To use an icon from this set, first prefix your `pebble-icon` with the icon set name, followed by a colon, ":", and then the icon id.

Example for using a simple icon from the pebble icon set:

    <pebble-icon icon="create"></iron-icon>


See [pebble-icon](#pebble-icon) for more information about working with icons.

See [pebble-iconset](#pebble-iconset) and [pebble-iconset-svg](#pebble-iconset-svg) for more information about how to create a custom icon set.



@group Iron Elements
@pseudoElement pebble-icons
@demo demo/index.html
-->
